import React from 'react';
import svgPaths from "./svg-iu444m7q7e";
import imgLogo5 from "figma:asset/e5dad6bae0662905552572585fbbaf176486bd11.png";
import imgImage1 from "figma:asset/931aae9b946a9239a69f6ca7a83883f624fde0e0.png";
import styles from './FooterDesktop.module.scss';

function Frame1() {
  return (
    <div className={styles.frame1}>
      <div className={styles.frame1Svg}>
        <svg className={styles.svg} fill="none" preserveAspectRatio="none" viewBox="0 0 1330 78">
          <g id="Frame 7">
            <path d={svgPaths.p1a0f3740} fill="var(--fill-0, white)" id="Rectangle 1" />
            <path d={svgPaths.p16f1bd10} fill="var(--fill-0, white)" id="Polygon 1" />
          </g>
        </svg>
      </div>
    </div>
  );
}

function Group() {
  return (
    <div className={styles.group}>
      <div className={styles.groupTitle} style={{ fontVariationSettings: "'wdth' 100" }}>
        <p className={styles.groupTitleText}>Contact</p>
      </div>
      <div className={styles.groupContent} style={{ fontVariationSettings: "'wdth' 100" }}>
        <p className={styles.groupAddress}>
          101 cours Charlemagne
          <br aria-hidden="true" />
          CS 20033
          <br aria-hidden="true" />
          69269 LYON CEDEX 02
          <br aria-hidden="true" />
          France
        </p>
        <p>+33 (0)4 26 73 40 00</p>
      </div>
    </div>
  );
}

function Frame() {
  return (
    <div className={styles.frame}>
      <div className={styles.frameTitle}>
        <p className={styles.frameTitleText}>Pages Légales</p>
      </div>
      <div className={styles.frameContent}>
        <ul className={styles.frameList}>
          <li className={styles.frameListItem}>
            <span className={styles.frameListText}>Mentions légales</span>
          </li>
          <li className={styles.frameListItem}>
            <span className={styles.frameListText}>Données personnelles</span>
          </li>
          <li className={styles.frameListItem}>
            <span className={styles.frameListText}>Accessibilité</span>
          </li>
          <li className={styles.frameListItem}>
            <span className={styles.frameListText}>Cookies</span>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default function FooterDesktop() {
  return (
    <div className={styles.footerDesktop} data-name="Footer/desktop">
      <Frame1 />
      <div className={styles.logo} data-name="Logo 5">
        <img alt="" className={styles.logoImg} src={imgLogo5} />
      </div>
      <Group />
      <Frame />
      <div className={styles.image} data-name="image 1">
        <img alt="" className={styles.imageImg} src={imgImage1} />
      </div>
    </div>
  );
}
